import classes from "../../../../beforeLogIn/Components/NavBar/NavBar.module.css";
import {Link} from "react-router-dom";
import logo from "../../../../beforeLogIn/Components/NavBar/logo.png";

function VerticalMenu(){
    return (
     <header className={classes.header}>
        <Link to={'/pacient'} ><div className={classes.logo}><img src={logo} alt="Logo" /></div></Link>
        <nav>
            <ul>
                <li><Link to={'/rezultate'}>Medics</Link></li>
                <li><Link to={'/consultatii'}>Services</Link></li>
                <li><Link to={'/programari'}>Opening Hours</Link></li>
                <li><Link to={'/programeaza'}>Contact</Link></li>
            </ul>
        </nav>
    </header>
    );

}

export default VerticalMenu;
